import logo from './media-encoder.png';
import './App.css';
import { FaFolderPlus } from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.css';


const icon = {
  fontSize: '80pt',
};

const title = {
  position: 'relative',
  fontSize:'16pt',
  marginTop: '55px',
};


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className='App-logo' alt='logo'/>
          <p>Encoder vos vid√©os</p>
        </header>

        <ul class="row justify-content-center">
            <div class="col-4">
              <li class="flex-item"><p>BPUBLI</p><div class="Icon"><FaFolderPlus style={icon}/></div></li>
            </div>
            <div class="col-4">
              <li class="flex-item"><p>BPUBLI</p><div class="Icon"><FaFolderPlus style={icon}/></div></li>
            </div>
          </ul>
      </div>
    );
  }
}

export default App;
